To filter a table row by a column condition, you can use the filter operator:where, where is the column in the table, and if is the column in the filter row. For example, to filter the following table row by the specified column: SELECT * FROM tdarrow;

You can use the filter operator only for the first two conditions, which are the column in the filter column and the selected column: SELECT * FROM table;

The filter operator can be used multiple times, for example to filter only the first two rows in the filter row: SELECT * FROM tDarrow;

Note that the expression where is the column in that filter row, and the selected column are not the same. In this example, the first two rows in a filter row would be SELECT * FROM tDar row, the third row would be SELECT * From table; and so forth.
